var React = require('react');
var ReactDOM = require('react-dom');

//var App = React.createElement('h1', null, 'My App!');

var Component = function(props) {
  console.log(props);
  return(
    <h1>My Sample App!</h1>
  );
}

ReactDOM.render(
  <Component msg='My Sample App!' color='blue'/>,
  document.getElementById('root')
);
